  return (
    <div style={{ minHeight: "100vh", backgroundColor: "#f8f9fa" }}>
      <Navbar />
      <main style={{ maxWidth: "1200px", margin: "0 auto", padding: "16px" }}>
        <Outlet /> 
      </main>
      <footer>
        <Footer/>
      </footer>
    </div>
  );
}
